function Delete (){
    return(
        <div>
            <section>
                <div>
                    <h3>Are you Sure ?</h3>
                </div>
                <div>
                    <button >Yes</button>
                    <button >No</button>
                </div>
            </section>
        </div>
    );
}

export default Delete;
